// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <Link to="/">
          <img src="/images/MAVJLogo.jpg" alt="MAVJ Logo" style={{ height: '40px' }} />
        </Link>
      </div>
      <ul className="navbar-links">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/MAVJStore">Store</Link></li>
        <li><Link to="/cart">Cart</Link></li>
        <li><Link to="/Journey2Enlightenment">J2E</Link></li>
        <li><Link to="/search">Search</Link></li>
        <li><Link to="/align">Align With Us</Link></li>
        <li><Link to="/vibrationalIntelligence">Vibrational Intelligence</Link></li>
        <li><Link to="/TheJourney">The Journey</Link></li>
        <li><Link to="/podcast">Podcast / Vlog</Link></li>
        <li><Link to="/Q">Q</Link></li>
        <li><Link to="/ContactUs">Contact Us</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
